import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { retailerAPI, cartAPI } from "../services/api";
import "./FarmerProducts.css";

const FarmerProducts = () => {
  const { id } = useParams(); // farmer id from URL
  const [products, setProducts] = useState([]);
  const [quantities, setQuantities] = useState({});
  const [farmer, setFarmer] = useState(null);
  const [retailer, setRetailer] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const storedRetailer = JSON.parse(localStorage.getItem("retailer"));
    if (!storedRetailer) {
      alert("Please log in as a retailer first!");
      navigate("/retailer/login");
      return;
    }
    setRetailer(storedRetailer);

    // Fetch farmer products
    retailerAPI.getFarmerById(id)
      .then((res) => {
        setFarmer(res.data);
        setProducts(res.data.products || []);
      })
      .catch((err) => console.error("Error fetching farmer:", err));
  }, [id, navigate]);

  // ‚úÖ Add to cart function
  const handleAddToCart = async (productId) => {
    if (!retailer) {
      alert("Retailer info not found. Please login again.");
      return;
    }

    const quantity = quantities[productId] || 1;

    try {
      const res = await cartAPI.addToCart(retailer.id, productId, quantity);
      console.log("Added to cart:", res.data);
      alert("‚úÖ Product added to cart successfully!");
    } catch (err) {
      console.error("Error adding to cart:", err);
      alert("‚ùå Failed to add to cart.");
    }
  };

  if (!farmer) return <p>Loading farmer products...</p>;

  return (
    <div className="farmer-products-page">
      <h1>üë®‚Äçüåæ {farmer.name}'s Products</h1>
      <p><b>üìç Address:</b> {farmer.address}</p>
      <hr />

      {products.length === 0 ? (
        <p>üö´ This farmer has no products yet.</p>
      ) : (
        <table className="product-table">
          <thead>
            <tr>
              <th>PRODUCT</th>
              <th>CATEGORY</th>
              <th>PRICE</th>
              <th>DESCRIPTION</th>
              <th>QTY</th>
              <th>ACTION</th>
            </tr>
          </thead>
          <tbody>
            {products.map((p) => (
              <tr key={p.id}>
                <td>{p.name}</td>
                <td>{p.category}</td>
                <td>‚Çπ{p.price}</td>
                <td>{p.description}</td>
                <td>
                  <input
                    type="number"
                    min="1"
                    value={quantities[p.id] || 1}
                    onChange={(e) =>
                      setQuantities({ ...quantities, [p.id]: e.target.value })
                    }
                    className="qty-input"
                  />
                </td>
                <td>
                  <button
                    className="add-btn"
                    onClick={() => handleAddToCart(p.id)}
                  >
                    üõí Add
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}

      <div style={{ marginTop: "20px" }}>
        <button
          onClick={() => navigate("/retailer/cart")}
          className="view-cart-btn"
        >
          üõçÔ∏è View Cart
        </button>
      </div>
    </div>
  );
};

export default FarmerProducts;
